import React from 'react'
import { Link } from "react-router-dom";
import charImage from './images/char.png';

export default function Card(props) {
    const showAlert =(msg)=>{
        alert(msg)
    }
    return (
        <div>
            <div className="card mt-3 mx-3" style={{ width: "18rem" }}>
                <img className="card-img-top" src={charImage} alt="no  rn" />
                <div className="card-body">
                    <h5 className="card-title">Card title</h5>
                    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <Link to="/" className="btn btn-primary" onClick={showAlert("vari")}>Go somewhere</Link>
                </div>
            </div>
        </div>
    )
}
